import { BrowserRouter, Routes, Route } from "react-router-dom";
import Post from './Components/Post';
import Categ from './Components/Categ';
import Layout from './Components/Layout';
import SubCategory from './Components/SubCateg';
import View from './Components/View';
const Admin = (props)=>{
    const Categories=props.Categories;
    const SubCategories=props.SubCategories;
    const fetchcateg=props.fetchcateg;
    const delcateg=props.delcateg;
    const fetchsubcateg=props.fetchsubcateg;
    const delsubcateg=props.delsubcateg;
    return(
        <div className="Admin">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout/>}>
          <Route index element={<Post Categories={Categories} SubCategories={SubCategories}/>} />
          <Route path="category" element={<Categ fetchcateg={fetchcateg} Categories={Categories} delcateg={delcateg}/>} />
          <Route path="view" element={<View SubCategories={SubCategories} Categories={Categories}/>} />
          <Route path='subcategory' element={<SubCategory fetchsubcateg={fetchsubcateg} SubCategories={SubCategories} delsubcateg={delsubcateg}/>}/>
        </Route>
      </Routes>
    </BrowserRouter>
      
    </div>
    )
}
export default Admin;
